import React from 'react';
import Card from './Card';
import sdata from  './sdata';




    
const App = () =>(
                     <>
                        <h1 className="heading_style ">list of top 5 seris</h1>
                         {sdata.map((val) => {
                          return (
                                 <Card 
                                   key    = {val.id}
                                   imgsrc = {val.imgsrc}
                                   title  = {val.title}
                                   stitle = {val.stitle}
                                   link   = {val.link}
                                 />
                                 )
                                             })}
                    </>
  
                );
export default App;
